const struct cam_mipi_sensor_mode* imx874_get_adaptive_mipi_info(struct cam_sensor_ctrl_t *s_ctrl, struct cam_mipi_info *mipi_info)
{
	CAM_INFO(CAM_SENSOR, "[AM_DBG] datarate : %d", mipi_info[FRONT_CAM].data_rate);

	for (int i = 0; i < ARRAY_SIZE(sensor_imx874_setfile_A_mipi_setting); i++)
	{
		if (mipi_info[FRONT_CAM].data_rate == sensor_imx874_setfile_A_mipi_setting[i].mipi_rate)
		{
			CAM_INFO(CAM_SENSOR, "[AM_DBG] Selected Mode A");
			return sensor_mipi_A_mode;
		}
	}

	CAM_ERR(CAM_SENSOR, "[AM_DBG] Can not find AM Mode.");
	return sensor_mipi_dummy_mode;
}

